import classes from "./LandingPage.module.css";
import { Fragment } from "react";
import Header from "./Header.js";
import Card from "../../UI/Card";
import Main from "./Main";

const LandingPage = () => {
  return (
    <Fragment>
      <Header />
      <Card>
        <Main />
        
      </Card>
    </Fragment>
  );
};

export default LandingPage;
